			ob_mlen=ob_idx[ob_i]; ob_i++;
			if(ob_hashkey==ob_key) ob_mv=ob_moves[ob_j+ob_random.Next(ob_mlen)];
			ob_j+=ob_mlen;
			}
		
		return(ob_mv);
	}

